                alt="171x180"
                src={jamesprofile}
              />
            </Col>
          </Row>
          <Row className="justify-content-md-center">
            <Col md="auto">

            </Col>
          </Row>

        </Container>
      </div>
    );
  }
}

export default AboutPage;
